import styled from "styled-components";

import { ReactComponent as Declined_ } from "./declined.svg";
import { ReactComponent as Approved_ } from "./approved.svg";
import { ReactComponent as Waiting_ } from "./waiting.svg";
import { ReactComponent as Total_ } from "./total.svg";
import { ReactComponent as User_ } from "./user.svg";
import { ReactComponent as Notification } from "./notification.svg";

export const DeclinedIcon = styled(Declined_)`
  padding: 0 0 10px;
  border-radius: 2px;
  box-shadow: 0 2px 7px 0 rgba(0, 0, 0, 0.15);
  background-color: #e25e5e;
`;
export const ApprovedIcon = styled.img`
height:0px;
  border-radius: 2px;
  box-shadow: 0 2px 7px 0 rgba(0, 0, 0, 0.15);
  background-color: #41d94e;
`;
export const WaitingIcon = styled(Waiting_)`
  padding: 0 0 8px;
  border-radius: 2px;
  box-shadow: 0 2px 7px 0 rgba(0, 0, 0, 0.15);
  background-color: #fc913f;
`;
export const TotalIcon = styled(Total_)`
  padding: 0 0 10px 1px;
  border-radius: 2px;
  box-shadow: 2px 2px 7px 0 rgba(0, 0, 0, 0.15);
  d-color: #1890ff;
`;

export const UserIcon = styled(User_)`
width: 24px;
height: 24px;
margin: 0 0 0 10px;
padding: 4px 3px 3px 4px;
background-color: #1890ff;
border-radius: 50%;

`;

export const BellIcon = styled(Notification)`

`;
